ALTER TABLE tbl_user
ADD COLUMN id_provisi int,
ADD COLUMN id_kabkot INT,
ADD COLUMN id_kec INT,
ADD COLUMN id_desa INT,
ADD COLUMN alamat TEXT;

CREATE FUNCTION func_nama_lengkap(gelar_depan VARCHAR(50), nama_user VARCHAR(200), gelar_blk VARCHAR(50))
RETURNS VARCHAR(300)
BEGIN
    DECLARE nama_lengkap VARCHAR(300);
    SET nama_lengkap = CONCAT(gelar_depan, ' ', nama_user, ' ', gelar_blk);
    RETURN nama_lengkap;
END;

CREATE EVENT update_canceled_event
ON SCHEDULE EVERY 5 MINUTE
ON COMPLETION PRESERVE
DO
BEGIN
    UPDATE tbl_pendaftaran
    SET is_cancled = '1',
        ket_cancled = '2'
    WHERE no_register IN (
        SELECT no_register
        FROM tbl_pendaftaran
        WHERE is_confrim = '0'
        AND tgl_daftar <= NOW() - INTERVAL 1 HOUR
    );
    UPDATE tbl_ruangan_bed
    SET sts_bed = '1'
    WHERE id_ruangan_bed IN (
        SELECT id_ruangan_bed
        FROM tbl_pendaftaran
        WHERE is_confrim = '0'
        AND tgl_daftar <= NOW() - INTERVAL 1 HOUR
    );
END;


ALTER TABLE tbl_ruangan_bed
ADD COLUMN sts_bed enum('0','1') COMMENT '0 = Terpakai, 1 = Tersedia';

ALTER TABLE tbl_ruangan
ADD COLUMN photo VARCHAR(255) DEFAULT 'default.jpg';